import React from "react";
import {myimage} from '../components/images/jennifer-burk-ECXB0YAZ_zU-unsplash.jpg'

function VideoText() {
  return (
    <div>
      <img src={myimage} class="video-text"/>
    </div>
  );
}

export default VideoText;
